DROP DATABASE IF EXISTS `bdDataViewer`;
CREATE DATABASE IF NOT EXISTS `bdDataViewer` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;
USE `bdDataViewer`;

-- --------------------------------------------------------

DROP TABLE IF EXISTS `Participation`;
DROP TABLE IF EXISTS `Media`;
DROP TABLE IF EXISTS `Date`;
DROP TABLE IF EXISTS `Heure`;
DROP TABLE IF EXISTS `Sexe`;




--
-- Structure de la table `Media`
--


CREATE TABLE IF NOT EXISTS `Media` (
  `idMedia`		int(3) ,
  `type`		varchar(10) ,
  `libMedia`	varchar(30) ,
  `categorie`	varchar(10),
  
  CONSTRAINT	pkMedia PRIMARY KEY (`idMedia`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- --------------------------------------------------------

--
-- Structure de la table `Heure`
--


CREATE TABLE IF NOT EXISTS `Heure` (
  `heure`		int(2) ,
  
  CONSTRAINT	pkHeure PRIMARY KEY (`heure`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- --------------------------------------------------------

--
-- Structure de la table `Date`
--


CREATE TABLE IF NOT EXISTS `Date` (
  `annee`		int(4) ,
  
  CONSTRAINT	pkDate PRIMARY KEY (`annee`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- --------------------------------------------------------


--
-- Structure de la table CONSTRAINT	pkModele PRIMARY KEY (`idSexe`)
--


CREATE TABLE IF NOT EXISTS `Sexe` (
  `idSexe`		int(1) ,
  `libSexe`		varchar(10) ,
  
  CONSTRAINT	pkSexe PRIMARY KEY (`idSexe`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- --------------------------------------------------------


--
-- Structure de la table `Participation`
--


CREATE TABLE IF NOT EXISTS `Participation` (
  `idSexe`		int(1) ,
   `annee`		int(4) ,
   `idMedia`	int(3) ,
   `heure`		int(2) ,
   `taux`		double(40,30) ,
   
  CONSTRAINT	pkParticipation PRIMARY KEY (`idSexe`,`annee`, `idMedia`,`heure`),
  CONSTRAINT	fkParticipationSexe FOREIGN KEY (`idSexe`) REFERENCES `Sexe` (`idSexe`),
  CONSTRAINT	fkParticipationDate FOREIGN KEY (`annee`) REFERENCES `Date` (`annee`),
  CONSTRAINT	fkParticipationHeure FOREIGN KEY (`heure`) REFERENCES `Heure` (`heure`),
  CONSTRAINT	fkParticipationMedia FOREIGN KEY (`idMedia`) REFERENCES `Media` (`idMedia`)
  
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

